import React from "react"
import './style.css';
import gif from './boom.gif'

function Header() {
  return (
    <header id="top">
      <div id="work"><img src={gif} alt="workinnit" border="0" /></div>
       {/* <img src="https://i.ibb.co/gDhkRZv/redber.jpg" alt="berserk"/>*/}
        <div id="wr-sec">
          <p id="subtit">
            <div>Icons made by <a href="https://www.flaticon.com/authors/stockio" title="Stockio">Stockio</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a>
            </div>
            Visual Arts</p>
          <p id="name">Ali Naqvi</p>
        </div>
    </header>

  );
}

export default Header;
